import React from 'react';
import ReactDom from  'react-dom';
import Cards from './Cards';
import './index.css';
import sdata from './sdata';

ReactDom.render(
  <>
  <h2 className='heading_style'> List of top 5 Netflex Series in 2020</h2>


  <Cards imgsrc= {sdata[0].imgsrc}
   title={sdata[0].title}
   sname={sdata[0].sname}
   link={sdata[0].link}

   />

  <Cards imgsrc="https://i.ytimg.com/vi/cdjQak1Roc0/hqdefault.jpg"
   title="A Netflex original Series" 
   sname="Extra Curricular"
   link="https://www.netflix.com/in/title/80990668"
   />

  <Cards imgsrc="https://www.rentaword.in/wp-content/uploads/2020/10/stranger-things-best-netflix-series.jpg"
   title="A Netflex original Series" 
   sname="Stranger Things"
   link="https://www.netflix.com/in/title/80057281"
   />


  </>,document.getElementById('root')
);
